import { ref } from "vue";

// Basic font size control - you'd likely implement this more robustly
// with a global state management (e.g., Pinia) or CSS variables.
const currentFontSize = ref(16); // Example base font size

const increaseFont = () => {
  currentFontSize.value += 1;
  document.documentElement.style.fontSize = `${currentFontSize.value}px`;
};

const decreaseFont = () => {
  currentFontSize.value -= 1;
  document.documentElement.style.fontSize = `${currentFontSize.value}px`;
};
